import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Router, Route,Swi } from 'react-router-dom';
import { Login,Register,Logout } from './components/Auth';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Router>

      <Route exact path='signup' Component={Register}/>
      <Route exact path='login' Component={Login}/>
     <Logout/>
     </Router>
     </BrowserRouter>

    </div>
  );
}

export default App;
